e].] This data may be processed for [specify purposes]. The legal basis for this processing is [consent] OR [our legitimate interests, namely [specify legitimate interests]] OR [the performance of a contract between you and us and/or taking steps, at your request, to enter into such a contract] OR [[specify basis]]. 3.13 We may process [any of your personal data identified in this policy] where necessary for [the establishment, exercise or defence of legal claims, whether in court proceedings or in an administrative or out-of-court procedure]. The legal basis for this processing is our legitimate interests, namely [the protection and assertion of our legal rights, your legal rights and the legal rights of others]. 3.14 We may process [any of your personal data identified in this policy] where necessary for [the purposes of obtaining or maintaining insurance coverage, managing risks, or obtaining professional advice]. The legal basis for this processing is our legitimate interests, namely [the proper protection of our business against risks]. 3.15 In addition to the specific purposes for which we may process your personal data set out in this Section 3, we may also process [any of your personal data] where such processing is necessary[ for compliance with a legal obligation to which we are subject, or] in order to protect your vital interests or the vital interests of another natural person. 3.16 Please do not supply any other person's personal data to us, unless we prompt you to do so. 4. Providing your personal data to others 4.1 We may disclose [your personal data] to any member of our group of companies (this means our subsidiaries, our ultimate holding company and all its subsidiaries) insofar as reasonably necessary for the purposes, and on the legal bases, set out in this policy.[ Information about our group of companies can be found at [URL].] 4.2 We may disclose [your personal data] to [our insurers and/or professional advisers] insofar as reasonably necessary for the purposes of [obtaining or maintaining insurance coverage, managing risks, obtaining professional advice, or the establishment, exercise or defence of legal claims, whether in court proceedings or in an administrative or out-of-court procedure]. 4.3 We may disclose [specify personal data category or categories] to [our suppliers or subcontractors][ identified at [URL]] insofar as reasonably necessary for [specify purposes]. 4.4 Financial transactions relating to [our website and services] [are] OR [may be] handled by our payment services providers, [identify PSPs]. We will share transaction data with our payment services providers only to the extent necessary for the purposes of [processing your payments, refunding such payments and dealing with complaints and queries relating to such payments and refunds]. You can find information about the payment services providers' privacy policies and practices at [URLs]. 4.5 We may disclose [your enquiry data] to [one or more of those selected third party suppliers of goods and services identified on our website] for the purpose of [enabling them to contact you so that they can offer, market and sell to you relevant goods and/or services].[ Each such third party will act as a data controller in relation to the enquiry data that we supply to it; and upon contacting you, each such third party will supply to you a copy of its own privacy policy, which will govern that third party's use of your personal data.] 4.6 In addition to the specific disclosures of personal data set out in this Section 4, we may disclose your personal data where such disclosure is necessary for compliance with a legal obligation to which we are subject, or in order to protect your vital interests or the vital interests of another natural person.[ We may also disclose your personal data where such disclosure is necessary for the establishment, exercise or defence of legal claims, whether in court proceedings or in an administrative or out-of-court procedure.] 5. International transfers of your personal data 5.1 In Section 5, we provide information about the circumstances in which your personal data may be transferred to [countries outside the European Economic Area (EEA)]. 5.2 We[ and our other group companies] have [offices and facilities] in [specify countries].[ The European Commission has made an "adequacy decision" with respect to [the data protection laws of each of these countries].][ Transfers to [each of these countries] will be protected by appropriate safeguards, namely [the use of standard data protection clauses adopted or approved by the European Commission, a copy of which can be obtained from [source]] OR [the use of binding corporate rules, a copy of which you can obtain from [source]] OR [[specify appropriate safeguards and means to obtain a copy]].] 5.3 The hosting facilities for our website are situated in [specify countries].[ The European Commission has made an "adequacy decision" with respect to [the data protection laws of each of these countries].][ Transfers to [each of these countries] will be protected by appropriate safeguards, namely [the use of standard data protection clauses adopted or approved by the European Commission, a copy of which you can obtain from [source]] OR [[specify appropriate safeguards and means to obtain a copy]].] 5.4 [Specify category or categories of supplier or subcontractor] [is] OR [are] situated in [specify countries].[ The European Commission has made an "adequacy decision" with respect to [the data protection laws of each of these countries].][ Transfers to [each of these countries] will be protected by appropriate safeguards, namely [the use of standard data protection clauses adopted or approved by the European Commission, a copy of which can be obtained from [source]] OR [[specify appropriate safeguards and means to obtain a copy]].] 5.5 You acknowledge that [personal data that you submit for publication through our website or services] may be available, via the internet, around the world. We cannot prevent the use (or misuse) of such personal data by others. 6. Retaining and deleting personal data 6.1 Section 6 sets out our data retention policies and procedure, which are designed to help ensure that we comply with our legal obligations in relation to the retention and deletion of personal data. 6.2 Personal data that we process for any purpose or purposes shall not be kept for longer than is necessary for that purpose or those purposes. 6.3 We will retain your personal data as follows: (a) [personal data category or categories] will be retained for a minimum period of [period] following [date], and for a maximum period of [period] following [date]. [additional list items] 6.4 In some cases it is not possible for us to specify in advance the periods for which your personal data will be retained. In such cases, we will determine the period of retention based on the following criteria: (a) the period of retention of [personal data category] will be determined based on [specify criteria]. [additional list items] 6.5 Notwithstanding the other provisions of this Section 6, we may retain your personal data where such retention is necessary for compliance with a legal obligation to which we are subject, or in order to protect your vital interests or the vital interests of another natural person. 7. Amendments 7.1 We may update this policy from time to time by publishing a new version on our website. 7.2 You should check this page occasionally to ensure you are happy with any changes to this policy. 7.3 We [may] OR [will] notify you of [changes] OR [significant changes] to this policy [by email or through the private messaging system on our website]. 8. Your rights 8.1 In Section 8, we have summarised the rights that you have under data protection law. Some of the rights are complex, and not all of the details have been included in our summaries. Accordingly, you should read the relevant laws and guidance from the